import React from "react";

// Component for the Navbar

function Nav(props) {
  return (
    <nav className="navbar">
      <div className="navname">
        <h5>Clicky Clack!</h5>
        {props.headingMessage} | Score: {props.currentScore} | Top Score: {props.topScore}
      </div>
    </nav>
  );
}

export default Nav;
